function smartchart_changeElemNames($str_symp_html){
	$str_append_id_nm = "_duplicate";
	$ptrn = '/((name|id|for)\s*=\s*"[a-zA-Z0-9_]+"\s*)/';
	preg_match_all($ptrn, $str_symp_html, $matches);
	if(count($matches[0])>0){

		foreach($matches[0] as $keyy => $val){
			$val = trim($val);
			if($val == "id=\"d_bl_od\"" || $val == "id=\"d_bl_os\""){ continue; }

			//echo "<br/>".$val;
			$val1 = substr($val, 0, -1); //remove last comma
			$val1 = $val1."_duplicate\"";

			$str_symp_html = str_replace($val, $val1, $str_symp_html);//replace
		}

	}else{
		//echo "No match found";
	}
	return $str_symp_html;
}



