//check if finding is already done
function smartchart_isSympDone($symp,$exm, $stts){
	$ret=false;
	global $arrSESmry, $arr_sub_exm_inc, $arrSymp;

	//echo "<br/>TEST";

	foreach($arr_sub_exm_inc[$exm] as $k => $v){
		//echo "<br/>";
		//echo "<br/>in1";

		if(in_array($symp, $arrSymp[$v])){

			//echo "<br/>in2".$stts;
			//echo "".$arrSESmry[$exm][$k]["od"];


			if((strpos($stts, $k."_Od=1")!==false && stripos($arrSESmry[$exm][$k]["od"],$symp)!==false)||
				(strpos($stts, $k."_Os=1")!==false && stripos($arrSESmry[$exm][$k]["os"],$symp)!==false)){
				//$symp="";
				$ret=true;
			}
		}
	}

	return $ret;
}

//get status flags
function sc_getChangeStatus_divid($exam, $symp){
	global $arr_sub_exm_inc, $arrSymp;
	$arCI=array();$divId="";
	foreach($arr_sub_exm_inc[$exam] as $k => $v){
		if(in_array($symp, $arrSymp[$v])){
			$arCI[] = "elem_chng_div".$k."_Od";
			$arCI[] = "elem_chng_div".$k."_Os";
			$divId="div".$k;
			break;
		}
	}

	return array($arCI, $divId);
}

